import React from 'react';
// import './App.css';

const Navbar = () => {
  return (
    <header>
    <nav id="navbar">
        <ul>
            <li><a href="#home">Home</a></li>
            <li><a href="#hero">About</a></li>
            <li><a href="#projects">Work</a></li>
            <li><a href="#skills">Skills</a></li>
            <li><a href="#contact">Contact</a></li>

        </ul>
    </nav>
</header>
  );
};

export default Navbar;
